const TernaryOperator = () => {
  const age = 20;
  var ageCheck
  const ageCategory = (age) => {
    var ageCheck = age < 12 ? "child" : age < 20 ? "tennage" : "old people";
    return ageCheck;
  };

  return <>ageCategory:{ageCategory} age:{age} ageCheck:{ageCheck}</>;
};

export default TernaryOperator;
